import React from "react";
import styles from "./Footer.module.css";

const Footer = () => {
    return (
        <footer className={styles.footer}>
            <div className={styles.contents}>
                <h2 className={styles.title}>푸터어어어어어</h2>
            </div>
        </footer>
    );
};

export default Footer;
